public boolean equals(Object obj) {
  if (obj == null) {
    return false;
  } else if (obj == this) {
    return true;
  } else if (obj.getClass() != getClass()) {
    return false;
  } else {
    CallerContext rhs = (CallerContext) obj;
    return new EqualsBuilder()
        .append(context, rhs.context)
        .append(signature, rhs.signature)
        .isEquals();
  }
}
